import ExpenseItem from "./ExpenseItem"
import Card from "./Card"
import './Expenses.css'
function Expenses(props){
    return(
        <Card className="expenses">
            {
                props.expenses.map((exp)=> {
                return <ExpenseItem key={exp.id}
                    title={exp.title}
                    price={exp.amount}
                    date={exp.date}
                ></ExpenseItem>        
                
                })
      }
        </Card>
    )
}
export default Expenses
